function 读取(路径){
var 储存地=new java.io.File(路径)
if(储存地.exists()){
if(储存地.isFile()){
var 字符=""
var 编码=new java.io.InputStreamReader(new java.io.FileInputStream(储存地),"UTF-8")
var 读取=new java.io.BufferedReader(编码)
var 其它=null
while((其它=读取.readLine())!=null)
{
字符+=其它+"\n"
}
编码.close()
return 字符
}
}
}
